    require(msg.sender == owner(), "Ownable: caller is not the owner");

    // 2. Trading must not already be open (identical to the de-compiled second `require`)
    require(!tradingOpen, "trading is already open");

    // 3. Initialise UniswapV2 router (constant address used in the de-compiled bytecode)
